                details.append(f"{triple.subject} {triple.predicate} {triple.object}")

    if details:
        sentence = ""
        combined_details = []

        # Combine triples for better flow
        for i in range(len(details)):
            for j in range(i + 1, len(details)):
                detail1 = details[i]
                detail2 = details[j]
                if "location" in detail1 and "architect" in detail2:
                    subject = detail1.split(" is located in ")[0]
                    architect = detail2.split(", designed by ")[1].split(" ")[0]
                    location = detail1.split(" is located in ")[1].split(".")[0]
                    combined_details.append(f"{subject}, designed by {architect}, is located in {location}.")
                    details[i] = ""
                    details[j] = ""
                    break
                elif "country" in detail1 and "capital" in detail2:
                    country = detail1.split(" is located in ")[0]
                    capital = detail2.split(" has ")[1].split(" as its capital")[0]
                    combined_details.append(f"{country} has {capital} as its capital.")
                    details[i] = ""
                    details[j] = ""
                    break
                elif "buildingStartDate" in detail1 and "completionDate" in detail2:
                    subject = detail1.split("Construction of ")[1].split(" started")[0]
                    start_date = detail1.split("started in ")[1].split(".")[0]
                    completion_date = detail2.split("was completed in ")[1].split(".")[0]
                    combined_details.append(f"{subject}, construction of which started in {start_date}, was completed in {completion_date}.")
                    details[i] = ""
                    details[j] = ""
                    break

        # Add remaining details
        for detail in details:
            if detail:
                combined_details.append(detail)

        sentence = " ".join(combined_details) + "."

    return sentence

